import React, { useState, useEffect } from 'react';
import { Pie } from 'react-chartjs-2'; // Changed Bar to Pie component
import 'chart.js/auto'; // Import auto to handle chart.js registration

function AdminApp() {
  const [sessions, setSessions] = useState([]);
  const [selectedSession, setSelectedSession] = useState(null);
  const [analysisData, setAnalysisData] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    fetchSessions();
  }, []);

  const fetchSessions = async () => {
    setIsLoading(true);
    try {
      const response = await fetch('http://localhost:5000/api/sessions'); // Updated endpoint
      if (!response.ok) {
        throw new Error('Failed to fetch sessions');
      }
      const data = await response.json();
      setSessions(data);
    } catch (error) {
      console.error('Error fetching sessions:', error);
    } finally {
      setIsLoading(false);
    }
  };

  const handleSessionClick = async (sessionId) => {
    setSelectedSession(sessionId);
    try {
      const response = await fetch(`http://localhost:5000/analyze/${sessionId}`);
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      const data = await response.json();
      setAnalysisData(data);
    } catch (error) {
      console.error('Error analyzing session:', error);
    }
  };

  const handleBackToSessions = () => {
    setSelectedSession(null);
    setAnalysisData(null);
  };

  const renderSessionList = () => (
    <div style={{ width: '100%' }}>
      <h3>Session List</h3>
      {isLoading ? (
        <p>Loading sessions...</p>
      ) : (
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr style={{ backgroundColor: '#f4f4f4' }}>
              <th style={{ padding: '10px', border: '1px solid #ddd' }}>Username</th>
              <th style={{ padding: '10px', border: '1px solid #ddd' }}>Session ID</th>
              <th style={{ padding: '10px', border: '1px solid #ddd' }}>Date & Time</th>
              <th style={{ padding: '10px', border: '1px solid #ddd' }}>Action</th>
            </tr>
          </thead>
          <tbody>
            {sessions.map((session) => (
              <tr key={session.sessionId}>
                <td style={{ padding: '10px', border: '1px solid #ddd' }}>{session.username}</td>
                <td style={{ padding: '10px', border: '1px solid #ddd' }}>{session.sessionId}</td>
                <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                  {new Date(session.createdAt).toLocaleString()}
                </td>
                <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                  <button
                    onClick={() => handleSessionClick(session.sessionId)}
                    style={{
                      backgroundColor: '#4CAF50',
                      color: 'white',
                      padding: '5px 10px',
                      border: 'none',
                      borderRadius: '3px',
                      cursor: 'pointer',
                    }}
                  >
                    Get Analysis
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );

  const renderPieChart = () => {
    if (!analysisData || !analysisData.overallAnalysis) return null;

    const emotions = analysisData.overallAnalysis.emotions;
    const data = {
      labels: Object.keys(emotions),
      datasets: [
        {
          label: 'Emotion Analysis (%)',
          data: Object.values(emotions).map((v) => parseFloat(v)),
          backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56', '#4BC0C0', '#9966FF', '#FF9F40'],
        },
      ],
    };

    const options = {
      responsive: true,
      plugins: {
        legend: {
          position: 'top',
        },
      },
    };

    return (
      <div style={{ width: '60%', margin: '0 auto' }}>
        <h3 style={{ textAlign: 'center' }}>Overall Emotion Analysis</h3>
        <Pie data={data} options={options} />
      </div>
    );
  };

  const renderTable = () => {
    if (!analysisData || !analysisData.imageAnalyses) return null;

    return (
      <div style={{ overflowX: 'auto', marginTop: '20px' }}>
        <table style={{ width: '100%', borderCollapse: 'collapse', border: '1px solid #ddd' }}>
          <thead>
            <tr>
              <th style={{ border: '1px solid #ddd', padding: '12px', backgroundColor: '#f2f2f2', textAlign: 'center' }}>Webcam Capture</th>
              <th style={{ border: '1px solid #ddd', padding: '12px', backgroundColor: '#f2f2f2', textAlign: 'center' }}>Game Screenshot</th>
              <th style={{ border: '1px solid #ddd', padding: '12px', backgroundColor: '#f2f2f2', textAlign: 'center' }}>Analysis</th>
            </tr>
          </thead>
          <tbody>
            {analysisData.imageAnalyses.map((analysis, index) => (
              <tr key={index} style={{ borderBottom: '1px solid #ddd' }}>
                <td style={{ border: '1px solid #ddd', padding: '12px', textAlign: 'center' }}>
                  <img
                    src={`http://localhost:5000/uploads/webcam_images/${selectedSession}/${analysis.imagePath}`}
                    alt={`Webcam ${index}`}
                    style={{ width: '100%', height: 'auto', borderRadius: '5px' }}
                    loading="lazy"
                  />
                </td>
                <td style={{ border: '1px solid #ddd', padding: '12px', textAlign: 'center' }}>
                  <img
                    src={`http://localhost:5000/uploads/game_screenshots/${selectedSession}/screenshot_${index}.png`}
                    alt={`Game Screenshot ${index}`}
                    style={{ width: '100%', height: 'auto', borderRadius: '5px' }}
                    loading="lazy"
                  />
                </td>
                <td style={{ border: '1px solid #ddd', padding: '12px' }}>
                  {Object.entries(analysis.emotions).map(([emotion, value]) => (
                    <p key={emotion} style={{ margin: '5px 0' }}>
                      {emotion}: {parseFloat(value).toFixed(2)}%
                    </p>
                  ))}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div style={{ padding: '20px', maxHeight: '100vh', overflowY: 'auto' }}>
      <h2>Admin Dashboard</h2>
      {selectedSession ? (
        <div style={{ width: '100%' }}>
          <h3>Analysis for Session: {selectedSession}</h3>
          {renderTable()}
          <button
            onClick={handleBackToSessions}
            style={{
              backgroundColor: '#A2C2E2',
              color: '#fff',
              padding: '10px 15px',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
              marginTop: '20px',
              display: 'block',
              marginLeft: 'auto',
              marginRight: 'auto',
            }}
          >
            Back to Sessions
          </button>
        </div>
      ) : (
        renderSessionList()
      )}
    </div>
  );
}

export default AdminApp;
